#include <iostream>
#include <vector>
#include <queue>
using namespace std;

class Solution
{
public:
    int shortestPathBinaryMatrix(vector<vector<int>> &grid)
    {
        if (grid[0][0] == 1)
        {
            return -1;
        }
        int n = grid.size();
        vector<vector<int>> shortest(n, vector<int>(n, 1000));
        vector<vector<bool>> visited(n, vector<bool>(n, false));
        shortest[0][0] = 1;
        visited[0][0] = 1;
        queue<pair<int, int>> q;
        pair<int, int> coordinates(0, 0);
        q.push(coordinates);
        while (!q.empty())
        {
            coordinates = q.front();
            q.pop();
            int i = coordinates.first;
            int j = coordinates.second;
            if (i > 0 && j > 0 && grid[i - 1][j - 1] == 0 && !visited[i-1][j-1])
            {
                shortest[i - 1][j - 1] = min(shortest[i - 1][j - 1], shortest[i][j] + 1);
                pair<int, int> coordinates(i-1, j-1);
                q.push(coordinates);
                visited[i-1][j-1] = true;
            }
            if (i > 0 && grid[i - 1][j] == 0 && !visited[i-1][j])
            {
                shortest[i - 1][j] = min(shortest[i - 1][j], shortest[i][j] + 1);
                pair<int, int> coordinates(i-1, j);
                q.push(coordinates);
                visited[i-1][j] = true;
            }
            if (j > 0 && grid[i][j - 1] == 0 && !visited[i][j-1])
            {
                shortest[i][j - 1] = min(shortest[i][j - 1], shortest[i][j] + 1);
                pair<int, int> coordinates(i, j-1);
                q.push(coordinates);
                visited[i][j-1] = true;
            }
            if (i < n - 1 && j < n - 1 && grid[i + 1][j + 1] == 0 && !visited[i+1][j+1])
            {
                shortest[i + 1][j + 1] = min(shortest[i + 1][j + 1], shortest[i][j] + 1);
                pair<int, int> coordinates(i+1, j+1);
                q.push(coordinates);
                visited[i+1][j+1] = true;
            }
            if (i < n - 1 && grid[i + 1][j] == 0 && !visited[i+1][j])
            {
                shortest[i + 1][j] = min(shortest[i + 1][j], shortest[i][j] + 1);
                pair<int, int> coordinates(i+1, j);
                q.push(coordinates);
                visited[i+1][j] = true;
            }
            if (j < n - 1 && grid[i][j + 1] == 0 && !visited[i][j+1])
            {
                shortest[i][j + 1] = min(shortest[i][j + 1], shortest[i][j] + 1);
                pair<int, int> coordinates(i, j+1);
                q.push(coordinates);
                visited[i][j+1] = true;
            }
            if (i > 0 && j < n - 1 && grid[i - 1][j + 1] == 0 && !visited[i-1][j+1])
            {
                shortest[i - 1][j + 1] = min(shortest[i - 1][j + 1], shortest[i][j] + 1);
                pair<int, int> coordinates(i-1, j+1);
                q.push(coordinates);
                visited[i-1][j+1] = true;
            }
            if (i < n - 1 && j > 0 && grid[i + 1][j - 1] == 0 && !visited[i+1][j-1])
            {
                shortest[i + 1][j - 1] = min(shortest[i + 1][j - 1], shortest[i][j] + 1);
                pair<int, int> coordinates(i+1, j-1);
                q.push(coordinates);
                visited[i+1][j-1] = true;
            }
        }

        for (int i = 0; i < n; ++i)
        {
            for (int j = 0; j < n; ++j)
            {
                cout << shortest[i][j] << " ";
            }
            cout << endl;
        }
        if (shortest[n - 1][n - 1] >= 1000)
        {
            return -1;
        }
        return shortest[n - 1][n - 1];
    }
};

int main()
{
    Solution s;
    vector<vector<int>> test1;
    vector<int> row1{0, 1, 1, 1, 0};
    vector<int> row2{0, 1, 1, 0, 0};
    vector<int> row3{0, 1, 0, 1, 0};
    vector<int> row4{0, 0, 1, 1, 0};
    vector<int> row5{1, 1, 1, 1, 0};

    test1.push_back(row1);
    test1.push_back(row2);

    test1.push_back(row3);
    test1.push_back(row4);
    test1.push_back(row5);

    cout << s.shortestPathBinaryMatrix(test1) << endl;
}

